import React, {Component} from 'react';

class pie extends Component{
    state={};
    render(){
        return(
            <div className="abajo">                
                <footer>           
                    <div>
                    <p>Vive deporte, es una empresa la cual se encarga de realizar eventos deportivos en el estado de Yucatán.<br/>
                    Calle 10 #354 x 20 y 37 diag. Pedregales de tanlum, Mérida Yucatán.
                    </p>
                    </div>

                    &copy; Todos los derechos reservados
                </footer>
            </div>

        )
    }
}
export default pie;
